import logo from './logo.svg';
import './App.css';
import Logoutbutton from './Logoutbutton';
import Sidebar from './Sidebar';


function App() {
  const scores = 5;
  return (
    <div className="App">
      <h1>Welcome to my app</h1>
      <Scorebar scores={scores} />
      <Logoutbutton />
      <Sidebar />
    </div>
  );
}

export default App;
